import React, { Component } from 'react'
import axios from 'axios'

class Cities extends Component {
    constructor(props) {
        super(props);

        this.state = {
            cities: [],
        }
    }
    componentDidMount(){
        fetch('http://localhost:8080/app/cities')
        .then(results => {
            //return results.json();
            console.log(results)
        })
    }
    render() {
        return (
            <div></div>
        )
    }
}

export default Cities;
